import React, { useEffect } from 'react';
import apicidades from '../../services/apicidades';

export default function Detail() {

    useEffect(() => {
        async function loading(){
            const response = await apicidades.get();
            console.log(response.data);
        }
        loading();
    }, [])
    return(
        <div>
            <h1>My Detail</h1>
        </div>
    );
}
